Disney viert een hedendaagse klassieker van de regisseurs van De Kleine Zeemeermin en Aladdin. Ontdek in deze briljante versie van `s werelds meest beroemde kus wat er echt gebeurde nadat de prinses de kikker kuste. 
Dit hilarische avontuur springt van het scherm met prachtige animaties, onweerstaanbare muziek en onvergetelijke personages. Betreed Prinses Tiana s wereld van pratende kikkers, zingende krokodillen en smoorverliefde vuurvliegjes en zie hoe ze op een ongelofelijke reis gaat door de mystieke moerassen van Louisiana. Aangespoord door een beetje moed en een grote droom komen deze nieuwe vrienden erachter wat er echt belangrijk is in het leven... liefde, familie en vriendschap.
De Prinses en de Kikker is een ongelofelijke filmbelevenis waar het hele gezin keer op keer van zal willen genieten! 
