Disney celebrates a contemporary classic of directors of The Little Mermaid and Aladdin. Discover in this brilliant version of the world's most famous kiss what really happened after the princess kissed the frog.
This hilarious adventure jumps off the screen with beautiful animation, compelling music and unforgettable characters. Enter Princess Tiana's world of talking frogs, crocodiles and singing lovesick fireflies and watch them on an incredible journey through the mysterious swamps of Louisiana. Spurred by a little courage and a big dream, these new friends find out what's really important in life ... love, family and friendship.
The Princess and the Frog is an incredible movie experience that your family will want again and again enjoy!

